import Modal from "../../components/MODAL_TEST";
import { useModal } from "../../hooks/useModal";

const Diary = () => {
  const { Modal, isModalOpen, closeModal } = useModal();
  return (
    <div>
      This is Diary page.
      <Modal
        isModalOpen={isModalOpen}
        close={closeModal}
        label="잘못된 이메일입니다!"
      />
    </div>
  );
};

export default Diary;
